import style from "./Filter.module.css"
import Horizontal from "./Range";

function Filter(){
    return(
        <div className={style.Filter}>
            <div className={style.title}>
                <p>PRICE</p>
            </div>
            <div className={style.horizonal}>
                <Horizontal />
            </div>
            <div className={style.cameraCont}>
                <div>

                </div>
            </div>
        </div>
    )
}
export default Filter
